import About from "../../pages/About";
import Post
	from "../../pages/Post";
import PostIdPage from "../../pages/PostIdPage";
export const routes = [
	{
		path: '/about',
		component: <About />,
		exact: true
	},
	{
		path: '/post',
		component: <Post />,
		exact: true
	},
	{
		path: '/about/:id',
		component: PostIdPage,
		exact: true
	}
]
